    <!-- Cuttle Page Load Monitor -->
    <script>
        window.cuttle_pageLoadData = {
            url: window.location.href,
            userAgent: window.navigator.userAgent,
            startTime: Date.now(),
            checkpoints: [],
            errors: [],
        };
        const apiBaseUrl = "https://api.cuttle.xyz";
        const logEvent = (eventName, metadata) => {
            const data = new Blob([JSON.stringify({ eventName, metadata })], {
                type: "application/json; charset=utf-8",
            });
            navigator.sendBeacon(apiBaseUrl + "/api/v1/logEvent", data);
        };
        const logPageLoadError = (event) => {
            const data = window.cuttle_pageLoadData;
            if (typeof data === "object" && Array.isArray(data.errors)) {
                const error = { time: Date.now() };
                if (event instanceof ErrorEvent) {
                    // There was an error in a script.
                    error.message = event.message;
                    error.filename = event.filename;
                    error.line = event.lineno;
                } else if (event instanceof PromiseRejectionEvent) {
                    // A error happened inside of an async function.
                    error.message = event.reason;
                } else if (event.target instanceof HTMLScriptElement) {
                    // A script failed to load.
                    error.filename = event.target.src;
                }
                data.errors.push(error);
            }
        };
        const isAppInteractive = () =>
            window.cuttle_pageLoadData.checkpoints.some(
                (checkpoint) => checkpoint.name === "mount app",
            );
        const onVisibilityChange = () => {
            if (document.visibilityState !== "hidden") return;
            if (window.cuttle_pageLoadData.sessionDuration) return;
            const endTime = Date.now();
            const sessionDuration = endTime - window.cuttle_pageLoadData.startTime;
            if (sessionDuration < 10000) return;
            window.cuttle_pageLoadData.sessionDuration = sessionDuration;
            if (!isAppInteractive()) {
                // The page still wasn't interactive after 10s..
                logEvent("slow page load", window.cuttle_pageLoadData);
            }
        };
        window.addEventListener("error", logPageLoadError, true);
        window.addEventListener("unhandledrejection", logPageLoadError);
        window.addEventListener("visibilitychange", onVisibilityChange);
    </script>
